import React, { useEffect, useRef, useState, useMemo } from 'react';

const Skills = () => {
    const [isVisible, setIsVisible] = useState(false);
    const [hoveredSkill, setHoveredSkill] = useState(null);
    const skillsRef = useRef(null);

    const skills = [
        {
            category: "Mobile Development",
            icon: "ðŸ“±",
            color: "from-blue-500 to-blue-700",
            items: [
                { name: "Android (Java/Kotlin)", level: 85, description: "Native Android development with modern architectures" },
                { name: "Android Studio", level: 90, description: "Proficient with IDE, debugging, and performance tools" },
                { name: "Firebase", level: 75, description: "Backend services, authentication, and real-time database" },
                { name: "SQLite", level: 70, description: "Local database management and optimization" }
            ]
        },
        {
            category: "Programming Languages",
            icon: "ðŸ’»",
            color: "from-green-500 to-emerald-700",
            items: [
                { name: "Java", level: 85, description: "Object-oriented programming and enterprise applications" },
                { name: "Kotlin", level: 80, description: "Modern Android development and cross-platform solutions" },
                { name: "JavaScript", level: 70, description: "Frontend and backend development with modern frameworks" },
                { name: "Python", level: 65, description: "Scripting, automation, and data analysis" }
            ]
        },
        {
            category: "Tools & Technologies",
            icon: "ðŸ› ï¸",
            color: "from-purple-500 to-purple-700",
            items: [
                { name: "Git/GitHub", level: 85, description: "Version control, collaboration, and CI/CD workflows" },
                { name: "REST APIs", level: 75, description: "API design, integration, and testing" },
                { name: "Material Design", level: 80, description: "Modern UI/UX principles and component libraries" },
                { name: "MVVM Architecture", level: 70, description: "Clean architecture patterns and separation of concerns" }
            ]
        },
        {
            category: "Other Skills",
            icon: "ðŸŽ¯",
            color: "from-orange-500 to-red-600",
            items: [
                { name: "Problem Solving", level: 90, description: "Analytical thinking and systematic debugging" },
                { name: "Team Collaboration", level: 85, description: "Agile methodologies and effective communication" },
                { name: "UI/UX Principles", level: 70, description: "User-centered design and accessibility standards" },
                { name: "Agile Development", level: 75, description: "Scrum, Kanban, and iterative development processes" }
            ]
        }
    ];

    const getSkillLevel = (level) => {
        if (level >= 85) return { text: "Expert", color: "text-green-600" };
        if (level >= 70) return { text: "Advanced", color: "text-blue-600" };
        if (level >= 55) return { text: "Intermediate", color: "text-yellow-600" };
        return { text: "Beginner", color: "text-gray-600" };
    };

    useEffect(() => {
        const observer = new IntersectionObserver(
            ([entry]) => {
                if (entry.isIntersecting) {
                    setIsVisible(true);
                }
            },
            { threshold: 0.3 }
        );

        if (skillsRef.current) {
            observer.observe(skillsRef.current);
        }

        return () => {
            if (skillsRef.current) {
                observer.unobserve(skillsRef.current);
            }
        };
    }, []);

    return (
        <section id="skills" className="py-20 bg-gray-50" ref={skillsRef}>
            <div className="container mx-auto px-4">
                <h2 className="text-4xl font-bold text-center mb-12 text-gray-800">Skills & Technologies</h2>

                <div className="max-w-6xl mx-auto grid md:grid-cols-2 gap-8">
                    {skills.map((skillCategory, index) => (
                        <div key={index} className="bg-white p-6 rounded-lg shadow-lg hover:shadow-xl transition-shadow duration-300">
                            <h3 className="text-xl font-semibold mb-6 text-gray-800">{skillCategory.category}</h3>
                            <div className="space-y-4">
                                {skillCategory.items.map((skill, skillIndex) => (
                                    <div key={skillIndex}>
                                        <div className="flex justify-between mb-2">
                                            <span className="text-gray-700 font-medium">{skill.name}</span>
                                            <span className="text-gray-500">{skill.level}%</span>
                                        </div>
                                        <div className="w-full bg-gray-200 rounded-full h-2">
                                            <div 
                                                className={`bg-blue-600 h-2 rounded-full transition-all duration-1000 ease-out ${isVisible ? 'opacity-100' : 'opacity-0'}`}
                                                style={{ 
                                                    width: isVisible ? `${skill.level}%` : '0%',
                                                    transitionDelay: `${skillIndex * 100}ms`
                                                }}
                                            ></div>
                                        </div>
                                    </div>
                                ))}
                            </div>
                        </div>
                    ))}
                </div>
            </div>
        </section>
    );
};

export default Skills;
